> Literal.getDouble() should supply a default value without throw exception.
> 
> for example:
> 
> ```java
> public double getDouble() {
>     try {
>         return Double.parseDouble(getValue().toString());
>     } catch (Throwable t) {
>         return Double.NaN;
>     }
> }
> ```
> 
> org.apache.commons.lang3.math.NumberUtils is also alternatives
> 
> ```java
> public double getDouble() {
>     return NumberUtils.toDouble(getValue().toString(), Double.NaN);
> }
> ```

